import React from 'react';
import {
  FriendListSection,
  FriendListItem,
  FriendListStatus,
  FriendListAvatar,
  FriendListName,
} from './friendList.styled';

const FriendList = ({ friends }) => {
  return (
    <FriendListSection>
      <ul>
        {friends.map((friend) => (
          <FriendListItem key={friend.id}>
            <FriendListStatus isOnline={friend.isOnline} />
            <FriendListAvatar src={friend.avatar} alt={friend.name} />
            <FriendListName>{friend.name}</FriendListName>
          </FriendListItem>
        ))}
      </ul>
    </FriendListSection>
  );
};

export default FriendList;
